import React, { useEffect, useState, Component } from "react";

class Pay extends Component {
  render() {
    return (
      <Router>
        <div>
          <Link to="C:\Users\SAI\Downloads\Frontend\Frontend\public\check.html">
            Press
          </Link>
          <Switch>
            <Route
              exact
              path="C:\Users\SAI\Downloads\Frontend\Frontend\public\check.html"
            />
          </Switch>
        </div>
      </Router>
    );
  }
}

export default Pay;
